import createLucideIcon from '../createLucideIcon';

const Shield = createLucideIcon('Shield', [
  ['path', { d: 'M12 22s8-4 8-10V5l-8-3-8 3v7c0 6 8 10 8 10z', key: '3xmgem' }],
]);

export default Shield;
